const Context = React.createContext()

import {logo2} from './logo2.png'

function ContextProvider(props) {


const smallLogo= <img src={logo2} alt='' />


return (
<Context.Provider value={{smallLogo}}>
{props.children}
</Context.Provider>
)
}

export {ContextProvider, Context}
